import React from "react";
import "../scss/components/Empty.css";
const Empty = () => {
  return (
    <div>
      <h1>
        <span>C</span>
        <span>O</span>
        <span>L</span>
        <span>O</span>
        <span>R</span> 
        <span>F</span>
        <span>O</span>
        <span>N</span>
        <span>T</span>
        <span>S</span>
        <span>!</span>
      </h1>
    </div>
  );
};

export default Empty;
